import fs from 'fs';
import path from 'path';

import React from 'react';
import ReactDomServer from 'react-dom/server';

import App from '../src/App';

const express = require('express');
const mongoose = require('mongoose');
mongoose.connect('mongodb+srv://james:Autumn9603@news.doh4c.mongodb.net/news?retryWrites=true&w=majority', { useNewUrlParser: true, useUnifiedTopology: true })
const cors = require('cors');
const app = express();

app.use(express.json());
app.use(express.urlencoded({extended:true}))
app.use(cors());

app.use('^/$', (req, res, next) => {
    fs.readFile(path.resolve('./build/index.html'), 'utf-8', (err, data) => {
        if(err) {
            console.log(err)
            return res.status(500).send("Some shit went wrong")
        }
        return res.send(data.replace('<div id="root">', `<div id="root">${ReactDomServer.renderToString(<App />)}</div>`))
    })
})

app.use(express.static(path.resolve(__dirname, '..', '/build')))

app.use('/api', require('../routes/news'))
app.use('/api', require('../routes/image'))


const PORT = process.env.PORT || 5000;

app.listen(PORT, () => console.log(`The server has started on port: ${PORT}`));

